(393, '<p>Which of the following sorting procedures is the slowest?</p><p>&nbsp;</p>', '<p>Quick sort</p>', '<p>Heap sort</p>', '<p>Shell sort</p>', '<p>Bubble sort</p>', '4', 13, 1),
